import { useState, useEffect } from "react";
import Layout from "../layout";
import Button from "../components/button";
import Bin from "../icons/bin";

function Cart() {
  const [products, setProducts] = useState([]);
  const [size, setSize] = useState([]);
  const [color, setColor] = useState([]);
  const shipping = 40;

  useEffect(() => {
    const cart = JSON.parse(sessionStorage.getItem("cart"));
    if (cart) {
      const cartProducts = cart.map((item) => item.product);
      const cartSizes = cart.map((item) => item.size);
      const cartColors = cart.map((item) => item.color);
      setProducts(cartProducts);
      setSize(cartSizes);
      setColor(cartColors);
    }
  }, []);

  function scrapCart(slug) {
    const cart = JSON.parse(sessionStorage.getItem("cart"));
    setProducts(products.filter((product) => product.slug !== slug));
    sessionStorage.setItem(
      "cart",
      JSON.stringify(cart.filter((item) => item.product.slug !== slug)),
    );
  }

  return (
    <Layout>
      <div className="w-9/12 pt-10 m-auto *:inline-block *:align-top">
        <div className="w-3/5">
          <h3 className="font-medium text-2xl text-gray-700 mb-5">Bag</h3>
          {products.length && size
            ? products.map((product, i) => (
                <div key={i} className={i}>
                  <div className="*:inline-block *:align-top">
                    <img
                      className="w-1/4 h-24 object-contain p-4 bg-gray-100 mr-4"
                      src={product.image}
                      alt={product.name}
                    />
                    <div className="w-4/12">
                      <h4>
                        <a href={`/product/${product.slug}`}>{product.name}</a>
                      </h4>
                      <h5 className="font-light text-gray-500">
                        {product.category} Shoes
                      </h5>
                      <h5 className="text-sm font-light text-gray-500 pt-2">
                        Size: {size[i]}
                      </h5>
                      <h5 className="text-sm font-light text-gray-500 p2-2">
                        Color: {color[i]}
                      </h5>
                    </div>
                    <div className="w-3/12 mr-4 text-right">
                      <h4>${product.price}.00</h4>
                      <button
                        className="pt-12"
                        onClick={(_) => scrapCart(product.slug)}
                      >
                        <Bin />
                      </button>
                    </div>
                  </div>

                  <hr className="h-px my-8 bg-gray-200 w-11/12" />
                </div>
              ))
            : "There are no items in your bag"}
        </div>
        <div className="w-2/5 text-gray-700">
          <h3 className="font-medium text-xl text-gray-700 mb-5">Summary</h3>
          <div className="mb-3">
            <h5 className="inline-block w-9/12">Subtotal</h5>
            <h5 className="inline-block w-3/12 text-right">
              {products &&
                size &&
                "$" +
                  products.reduce(
                    (total, product) => total + parseFloat(product.price),
                    0,
                  ) +
                  ".00"}
            </h5>
          </div>
          <div className="">
            <h5 className="inline-block w-9/12">Sales Tax</h5>
            <h5 className="inline-block w-3/12 text-right">
              {products.length && size ? `$${shipping}.00` : "Free"}
            </h5>
          </div>
          <hr className="h-px my-5 bg-gray-200" />
          <div className="">
            <h5 className="inline-block w-9/12">Total</h5>
            <h5 className="inline-block w-3/12 text-right font-medium text-gray-900">
              {products &&
                size &&
                "$" +
                  products.reduce(
                    (total, product) => total + parseFloat(product.price),
                    shipping,
                  ) +
                  ".00"}
            </h5>
          </div>
          <hr className="h-px my-5 bg-gray-200" />
          <a href="/checkout">
            <Button text="Checkout" />
          </a>
        </div>
      </div>
    </Layout>
  );
}

export default Cart;
